function Navbar() {
    return (
        <nav>
            <nav className="nav">
                <img 
                    src="github-mark.png" 
                    className="nav-logo"
                    alt="GitHub Logo"
                />
                <link href="https://github.com/Ankinen/ict-projects"/>
                <label>GitHub Repo</label>
            </nav>
        </nav>
    )
};

export default Navbar
